{
  "openapi": "3.0.1",
  "info": {
    "title": "Insights Management",
    "description": "The Insights Management API provides sellers with actionable information to optimize their listings:\n*   Sellers can locate best-selling items with Trending Items API so they can add those to their catalog of item offerings. \n*   Sellers can find out reasons why items go unpublished, fix the issue and republish those items.\n*   Sellers can use Listing Quality APIs to gather listing quality metrics about their items and find out any post-production issues that they can fix.\n*   Sellers can obtain their overall Listing Quality score, and locate any categories that show items with listing quality issues."
  },
  "servers": [
    {
      "url": "https://marketplace.walmartapis.com",
      "description": "Production URL"
    },
    {
      "url": "https://sandbox.walmartapis.com",
      "description": "Sandbox URL"
    }
  ],
  "security": [
    {
      "basicScheme": []
    }
  ],
  "paths": {
    "/v3/insights/items/unpublished/counts": {
      "get": {
        "tags": [
          "Insight"
        ],
        "summary": "Unpublished Item Counts",
        "description": "Get Count for Unpubished Item",
        "externalDocs": {
          "description": "View Guide",
          "url": "/doc/us/mp/us-mp-insights/#3880"
        },
        "operationId": "getUnpublishedItemCount",
        "parameters": [
          {
            "name": "fromDate",
            "in": "query",
            "description": "Returns all unpublished items count with reason codes since the given date",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "2020-09-23"
          },
          {
            "in": "header",
            "name": "Authorization",
            "description": "Basic authorization header. Base 64 encodes the Client ID and Client Secret retrieved in step two of the integration steps.",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Basic YzcyOTFjNmItNzI5MC00...."
          },
          {
            "in": "header",
            "name": "WM_SEC.ACCESS_TOKEN",
            "description": "The access token retrieved in the Token API call",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "eyJraWQiOiIzZjVhYTFmNS1hYWE5LTQzM....."
          },
          {
            "in": "header",
            "name": "WM_CONSUMER.CHANNEL.TYPE",
            "description": "A unique ID to track the consumer request by channel. Use the Consumer Channel Type received during onboarding",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "WM_QOS.CORRELATION_ID",
            "description": "A unique ID which identifies each API call and used to track and debug issues; use a random generated GUID for this ID",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "b3261d2d-028a-4ef7-8602-633c23200af6"
          },
          {
            "in": "header",
            "name": "WM_SVC.NAME",
            "description": "Walmart Service Name",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Walmart Service Name"
          }
        ],
        "responses": {
          "200": {
            "description": "Successful Operation",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "payload": {
                      "type": "array",
                      "items": {
                        "type": "object",
                        "properties": {
                          "unpublishedCount": {
                            "type": "string",
                            "description": "total count for unpublished Item"
                          },
                          "unpublishedValue": {
                            "type": "string",
                            "description": "total value for unpublished Item"
                          },
                          "unpublishedReasonCode": {
                            "type": "string",
                            "description": "the reason why item is unpublished"
                          }
                        }
                      }
                    }
                  }
                },
                "example": {
                  "payload": [
                    {
                      "unpublishedCount": "185",
                      "unpublishedValue": "2154.0",
                      "unpublishedReasonCode": "END_DATE"
                    },
                    {
                      "unpublishedCount": "3",
                      "unpublishedValue": "0.0",
                      "unpublishedReasonCode": "END_DATE,REASONABLE_PRICE_NOT_SATISFIED"
                    },
                    {
                      "unpublishedCount": "1",
                      "unpublishedValue": "0.0",
                      "unpublishedReasonCode": "NO_PRICE,END_DATE"
                    },
                    {
                      "unpublishedCount": "94",
                      "unpublishedValue": "1900.89",
                      "unpublishedReasonCode": "REASONABLE_PRICE_NOT_SATISFIED"
                    }
                  ]
                }
              }
            }
          }
        }
      }
    },
    "/v3/insights/items/unpublished/items": {
      "get": {
        "tags": [
          "Insight"
        ],
        "summary": "Unpublished Items",
        "description": "Get Unpublished Items",
        "externalDocs": {
          "description": "View Guide",
          "url": "/doc/us/mp/us-mp-insights/#3880"
        },
        "operationId": "getUnpublishedItems",
        "parameters": [
          {
            "name": "unpublishedReasonCode",
            "in": "query",
            "description": "Unpublished reason code",
            "required": false,
            "schema": {
              "type": "string",
              "default": "all"
            }
          },
          {
            "name": "fromDate",
            "in": "query",
            "description": "Returns all unpublished items since the given date",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "2020-09-23"
          },
          {
            "name": "limit",
            "in": "query",
            "description": "The number of items to be returned.",
            "required": false,
            "schema": {
              "type": "string",
              "default": "20"
            }
          },
          {
            "name": "offerLifecycleStatus",
            "in": "query",
            "description": "The lifecycle status of an item describes where the item listing is in the overall lifecycle. Examples of allowed values are ACTIVE , ARCHIVED, RETIRED.",
            "required": false,
            "schema": {
              "type": "string",
              "default": "all"
            }
          },
          {
            "name": "marketTrending",
            "in": "query",
            "description": "Filter the item list to return only items that are trending on Walmart.com",
            "required": false,
            "schema": {
              "type": "string",
              "default": "false"
            }
          },
          {
            "name": "itemsWithInventory",
            "in": "query",
            "description": "Filter the item list to return only items that have inventory",
            "required": false,
            "schema": {
              "type": "string",
              "default": "true"
            }
          },
          {
            "in": "header",
            "name": "Authorization",
            "description": "Basic authorization header. Base 64 encodes the Client ID and Client Secret retrieved in step two of the integration steps.",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Basic YzcyOTFjNmItNzI5MC00...."
          },
          {
            "in": "header",
            "name": "WM_SEC.ACCESS_TOKEN",
            "description": "The access token retrieved in the Token API call",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "eyJraWQiOiIzZjVhYTFmNS1hYWE5LTQzM....."
          },
          {
            "in": "header",
            "name": "WM_CONSUMER.CHANNEL.TYPE",
            "description": "A unique ID to track the consumer request by channel. Use the Consumer Channel Type received during onboarding",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "WM_QOS.CORRELATION_ID",
            "description": "A unique ID which identifies each API call and used to track and debug issues; use a random generated GUID for this ID",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "b3261d2d-028a-4ef7-8602-633c23200af6"
          },
          {
            "in": "header",
            "name": "WM_SVC.NAME",
            "description": "Walmart Service Name",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Walmart Service Name"
          }
        ],
        "responses": {
          "200": {
            "description": "Successful Operation",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "payload": {
                      "type": "array",
                      "items": {
                        "type": "object",
                        "properties": {
                          "gtin": {
                            "type": "string",
                            "description": "The GTIN-compatible Product ID (i.e. UPC or EAN)"
                          },
                          "marketPrice": {
                            "type": "object",
                            "properties": {
                              "amount": {
                                "type": "string",
                                "description": "The numerical value of the price"
                              },
                              "currency": {
                                "type": "string",
                                "description": "The currency type"
                              }
                            }
                          },
                          "offerStartDate": {
                            "type": "string",
                            "description": "The Date when item becomes available to sell in Walmart"
                          },
                          "marketTrending": {
                            "type": "string",
                            "description": "If item is trending in walmart"
                          },
                          "lifecycleStatus": {
                            "type": "string",
                            "description": "The lifecycle status of an item describes where the item listing is in the overall lifecycle"
                          },
                          "unpublishReasons": {
                            "type": "string",
                            "description": "It outlines the reason for an item when unpublished"
                          },
                          "conversionRate": {
                            "type": "integer",
                            "description": "Percentage of number of items that are converted into sales",
                            "format": "int32"
                          },
                          "productName": {
                            "type": "string",
                            "description": "A seller-specified, alphanumeric string uniquely identifying the product name"
                          },
                          "gmvAmount": {
                            "type": "object",
                            "properties": {
                              "amount": {
                                "type": "integer",
                                "description": "The numerical value of the price",
                                "format": "int32"
                              },
                              "currency": {
                                "type": "string",
                                "description": "The currency type"
                              }
                            }
                          },
                          "itemId": {
                            "type": "string",
                            "description": "Specifies the item identifier generated by Walmart"
                          },
                          "customerRating": {
                            "type": "string",
                            "description": "An average rating number for the item from customers"
                          },
                          "pageViews": {
                            "type": "integer",
                            "description": "number of times this item is viewed by customers",
                            "format": "int32"
                          },
                          "price": {
                            "type": "object",
                            "properties": {
                              "price": {
                                "type": "integer",
                                "format": "int32"
                              },
                              "issueTitle": {
                                "type": "object"
                              },
                              "competitorPrice": {
                                "type": "number",
                                "format": "double"
                              },
                              "walmartShipping": {
                                "type": "object"
                              },
                              "competitorShipping": {
                                "type": "object"
                              },
                              "score": {
                                "type": "object"
                              },
                              "additionalDes": {
                                "type": "object"
                              },
                              "asin": {
                                "type": "string"
                              }
                            }
                          },
                          "unpublishedDate": {
                            "type": "string",
                            "description": "The Date item becomes to Unpublished"
                          },
                          "brand": {
                            "type": "string",
                            "description": "Specifies the item brand"
                          },
                          "sku": {
                            "type": "string",
                            "description": "String of letters and/or numbers a partner uses to identify the item"
                          },
                          "productType": {
                            "type": "string",
                            "description": "A seller-specified, alphanumeric string uniquely identifying the Product Type"
                          },
                          "offerEndDate": {
                            "type": "string",
                            "description": "The Date when item becomes unavailable to sell in Walmart"
                          },
                          "publishStatus": {
                            "type": "string",
                            "description": "The status of an item when the item is in the submission process"
                          }
                        }
                      }
                    },
                    "totalCount": {
                      "type": "integer",
                      "description": "total number of unpublished items",
                      "format": "int32"
                    },
                    "totalGmvAmount": {
                      "type": "object",
                      "properties": {
                        "amount": {
                          "type": "string",
                          "description": "The numerical value of the price"
                        },
                        "currency": {
                          "type": "string",
                          "description": "The currency type"
                        }
                      },
                      "description": "Gross Merchandise Value of the total result set"
                    }
                  }
                },
                "example": {
                  "payload": [
                    {
                      "gtin": "00847321012345",
                      "marketPrice": {
                        "amount": "0.000000",
                        "currency": "USD"
                      },
                      "offerStartDate": "2020-01-06",
                      "marketTrending": "false",
