    "/v3/insights/items/listingQuality/score": {
      "get": {
        "tags": [
          "Insight"
        ],
        "summary": "Seller Listing Quality Score",
        "description": "Get the total Listing Quality Score for a seller's entire item catalog.",
        "externalDocs": {
          "description": "View Guide",
          "url": "/doc/us/mp/us-mp-insights/#3880"
        },
        "operationId": "getListingQualityScore",
        "parameters": [
          {
            "name": "viewTrendingItems",
            "in": "query",
            "description": "Specify whether or not to include seller's items that are trending in the Listing Quality Score.",
            "required": false,
            "schema": {
              "type": "boolean"
            }
          },
          {
            "name": "wfsFlag",
            "in": "query",
            "description": "Specify whether or not to include WFS-eligible items in the overall Listing Quality Score.",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "Authorization",
            "description": "Basic authorization header. Base 64 encodes the Client ID and Client Secret retrieved in step two of the integration steps.",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Basic YzcyOTFjNmItNzI5MC00...."
          },
          {
            "in": "header",
            "name": "WM_SEC.ACCESS_TOKEN",
            "description": "The access token retrieved in the Token API call",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "eyJraWQiOiIzZjVhYTFmNS1hYWE5LTQzM....."
          },
          {
            "in": "header",
            "name": "WM_CONSUMER.CHANNEL.TYPE",
            "description": "A unique ID to track the consumer request by channel. Use the Consumer Channel Type received during onboarding",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "WM_QOS.CORRELATION_ID",
            "description": "A unique ID which identifies each API call and used to track and debug issues; use a random generated GUID for this ID",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "b3261d2d-028a-4ef7-8602-633c23200af6"
          },
          {
            "in": "header",
            "name": "WM_SVC.NAME",
            "description": "Walmart Service Name",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Walmart Service Name"
          }
        ],
        "responses": {
          "200": {
            "description": "Successful Operation",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "payload": {
                      "type": "object",
                      "properties": {
                        "overAllQuality": {
                          "type": "number",
                          "description": "Over All Quality ",
                          "format": "double"
                        },
                        "score": {
                          "type": "object",
                          "properties": {
                            "offerScore": {
                              "type": "number",
                              "description": "Offer Score",
                              "format": "double"
                            },
                            "contentScore": {
                              "type": "number",
                              "description": "Content Score",
                              "format": "double"
                            },
                            "ratingReviewScore": {
                              "type": "number",
                              "description": "Rating Review Score",
                              "format": "double"
                            }
                          },
                          "description": "Score"
                        },
                        "postPurchaseQuality": {
                          "type": "object",
                          "properties": {
                            "defectRatio": {
                              "type": "integer",
                              "description": "Defect Ratio",
                              "format": "int32"
                            },
                            "itemDefectCnt": {
                              "type": "integer",
                              "description": "Item Defect Count",
                              "format": "int32"
                            }
                          },
                          "description": "Post Purchase Quality"
                        }
                      }
                    }
                  }
                },
                "example": {
                  "payload": {
                    "score": {
                      "offerScore": 50,
                      "ratingReviewScore": 14.48,
                      "contentScore": 64.24
                    },
                    "postPurchaseQuality": {
                      "itemDefectCnt": 0,
                      "defectRatio": 0
                    },
                    "overAllQuality": 44.7
                  },
                  "status": "OK"
                }
              }
            }
          }
        }
      }
    },
    "/v3/insights/items/listingQuality/items": {
      "post": {
        "tags": [
          "Insight"
        ],
        "summary": "Item Listing Quality Details",
        "description": "Get each item's listing quality details including: item quality score, offer score, content score and issues, and item performance.",
        "externalDocs": {
          "description": "View Guide",
          "url": "/doc/us/mp/us-mp-insights/#3880"
        },
        "operationId": "itemsDetailsForListing",
        "parameters": [
          {
            "name": "limit",
            "in": "query",
            "description": "Specify number of items to return. If no limit is specified, API returns 200 items by default.",
            "required": false,
            "schema": {
              "type": "string",
              "default": "200"
            }
          },
          {
            "name": "nextCursor",
            "in": "query",
            "description": "Specify pagination for long list of items.",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "Authorization",
            "description": "Basic authorization header. Base 64 encodes the Client ID and Client Secret retrieved in step two of the integration steps.",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Basic YzcyOTFjNmItNzI5MC00...."
          },
          {
            "in": "header",
            "name": "WM_SEC.ACCESS_TOKEN",
            "description": "The access token retrieved in the Token API call",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "eyJraWQiOiIzZjVhYTFmNS1hYWE5LTQzM....."
          },
          {
            "in": "header",
            "name": "WM_CONSUMER.CHANNEL.TYPE",
            "description": "A unique ID to track the consumer request by channel. Use the Consumer Channel Type received during onboarding",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "WM_QOS.CORRELATION_ID",
            "description": "A unique ID which identifies each API call and used to track and debug issues; use a random generated GUID for this ID",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "b3261d2d-028a-4ef7-8602-633c23200af6"
          },
          {
            "in": "header",
            "name": "WM_SVC.NAME",
            "description": "Walmart Service Name",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Walmart Service Name"
          }
        ],
        "requestBody": {
          "description": "Request payload",
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "query": {
                    "type": "object",
                    "properties": {
                      "field": {
                        "type": "string",
                        "description": "| Attribute | Description | Data Type\n| --- | ----------- | -------\n| title | Product Title | string |\n| sku | An arbitrary alphanumeric unique ID, seller-specified, identifying each item | string |\n| itemId | Specifies the item identifier generated by Walmart | string |",
                        "enum": [
                          "title",
                          "sku",
                          "itemId"
                        ]
                      },
                      "value": {
                        "type": "string"
                      }
                    }
                  },
                  "filters": {
                    "type": "array",
                    "items": {
                      "type": "object",
                      "properties": {
